import React from "react";
import _ from "lodash";
import "./BodyRow.css";

// TODO make this generalizable so that can feed in list of items and header title

const NUM_ITEMS = 10;
const BodyRow: React.FC = () => {
  return (
    <div>
      <div className="header-title">Tinkering</div>
      <div className="items">
        {_.range(NUM_ITEMS).map((index: number) => {
          return (
            <div key={index} className="coming-soon-block">
              Coming soon!
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default BodyRow;
